// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

contract Consent is Initializable, UUPSUpgradeable, OwnableUpgradeable {

    struct UserConsent {
        bool consented;
        uint256 consentedDate;
        address[] addressConsent;
        mapping (address => uint) addressConsentIndex;
        mapping (address => string) publicPGPKeys;
    }

    event UpdateConsent (
        bytes32 consentId,
        bool status,
        address user
    );

    event ADDPGPKey (
        bytes32 consentId,
        address addressConsent,
        address user
    );

    mapping(address => mapping (bytes32=> UserConsent)) users;

    function initialize() initializer public {
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    function _authorizeUpgrade(address) internal override onlyOwner {}

    function getConsent (bytes32 consentId, address user) external view returns (bool) {
        UserConsent storage userConsent = users[user][consentId];

        require(userConsent.consentedDate > 0, "Consent not registered");

        return userConsent.consented;
    }

    function updateConsent (bytes32 consentId, bool status) external {
        require(users[msg.sender][consentId].consented != status, "Status consent is already setted up");

        users[msg.sender][consentId].consented = status;
        users[msg.sender][consentId].consentedDate = block.timestamp;

        emit UpdateConsent(consentId, status, msg.sender);
    }

    function addPGPKey (bytes32 consentId, address addressConsent, string memory publicPGPKey) external {
        require(users[msg.sender][consentId].consentedDate != 0, "You have to approve or reject the consent.");


        users[msg.sender][consentId].publicPGPKeys[addressConsent] = publicPGPKey;
        users[msg.sender][consentId].addressConsent.push(addressConsent);
        users[msg.sender][consentId].addressConsentIndex[addressConsent] = 
            users[msg.sender][consentId].addressConsent.length - 1;

        emit ADDPGPKey(consentId, addressConsent, msg.sender);
    }

    function getPGPKeys (bytes32 consentId) external view returns (address[] memory, string[] memory){
        UserConsent storage userConsent = users[msg.sender][consentId];

        require(userConsent.consentedDate > 0, "Consent not registered");

        string[] memory PGPKeys_ = new string[](userConsent.addressConsent.length);

        for (uint i = 0; i < userConsent.addressConsent.length; i ++) {
            PGPKeys_[i] =  userConsent.publicPGPKeys[userConsent.addressConsent[i]];
        }

        return (userConsent.addressConsent, PGPKeys_);
    }
}
